import React from "react";
import { Cabecalho, Titulo, Botao  } from "./estiloHome";

function Home() {
  return (
    <div>
      <header>
        <Cabecalho>
          <Titulo>Target Music</Titulo>
          <div></div>
          <Botao>Sobre </Botao>
          <Botao></Botao>
          <Botao>Admin</Botao>
        </Cabecalho>
      </header>
      <body></body>
    </div>
  );
}

export default Home;
